import React from "react";

const headsect = () => {
  return (
    <div>
      <div class="container demo">
        <div class="content">
          <div id="large-header" class="large-header">
            <canvas id="demo-canvas"></canvas>
            <h1 class="main-title">
              <span class="thin">Explore</span> Spacess
            </h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default headsect;
